import { useState } from "react";

const Home = () => {
    const [name,setName]=useState('mario');
    const [age,setAge]=useState(20);

    const handleClick = () => {
        setName('luigi')
        setAge(30)
    }

    return ( 
        <div className="home">
            <h2>Homepage</h2>
            <p>{name} is {age} years old</p>
            <button onClick={handleClick}>Click me again</button>
        </div>
    );
}
 
export default Home;
